const transformedItems = items.map(item => {
    const absence = item.json;
    let transformedItem = { 'Name': absence.Employee };
    Object.assign(transformedItem, absence.datesToUpdate);
    return transformedItem;
});

// Merge items with the same 'Names'
const mergedItems = transformedItems.reduce((acc, item) => {
    // Find if the employee already exists in the accumulator
    const existingItemIndex = acc.findIndex(accItem => accItem.Name === item.Name);

    if (existingItemIndex !== -1) {
        // Merge the dates if employee already exists
        Object.assign(acc[existingItemIndex], item);
    } else {
        // Add new employee to the accumulator
        acc.push(item);
    }

    return acc;
}, []);

return mergedItems.map(item => ({ json: item }));

// Removing holiday dates from output
const holidayDates = items[0].json;
let result = [];

items.slice(1).forEach(item => {
  const person = item.json;
  let filteredHolidayDates = {};

  Object.keys(person).forEach(key => {
    if (key !== 'Name' && !holidayDates.hasOwnProperty(key)) {
      filteredHolidayDates[key] = person[key];
    }
  });

  result.push({json: {Name: person.Name, ...filteredHolidayDates}});
});

return result;

// Check if there are any input items
if (items.length === 0) {
    // If no items, return an empty array to avoid errors
    return [];
}

// Function to generate all dates between two given dates
function getDatesInRange(startDate, endDate) {
    const dateArray = [];
    let currentDate = new Date(startDate);
    const end = new Date(endDate);

    while (currentDate <= end) {
        dateArray.push(formatDate(new Date(currentDate)));
        currentDate.setDate(currentDate.getDate() + 1);
    }
    return dateArray;
}

// Function to reformat the date from 'YYYY-MM-DD' to 'DD/MM/YY'
function formatDate(date) {
    let day = date.getDate();
    let month = date.getMonth() + 1;
    let year = date.getFullYear().toString().substr(-2);

    return `${day}/${month}/${year}`;
}

// Assuming the data is in the first item of the incoming JSON
const dataString = items[0].json.data;

// Parse the JSON string
const parsedData = JSON.parse(dataString);

// Initialize an empty object for the transformed data
let transformedData = {};

// Loop through each item in the parsed data
for (let item of parsedData) {
    const startDate = item.startDate;
    const endDate = item.endDate;

    // Generate all dates between start and end dates
    const allDates = getDatesInRange(new Date(startDate), new Date(endDate));

    // Assign 'H' for each holiday date
    for (const date of allDates) {
        transformedData[date] = 'H';
    }
}

// Return the transformed data as a new item
return [{json: transformedData}];

// Start by iterating over the 'items' array
const outputData = [];

items.forEach(item => {
    // Check if the current item has an 'outs' array
    if (item.json && Array.isArray(item.json.outs)) {
        // Iterate over each object in the 'outs' array
        item.json.outs.forEach(out => {
            // Create a new item for each 'out' object and add it to the output array
          outputData.push({ json: out });
        });
    }
});

// Return the flattened output data
