    let rowData = { "No": i.toString() };

    for (const [date, value] of Object.entries(holidayData)) {
        rowData[date] = value;
    }

    updateData.push({ json: rowData });
}

return updateData;

return items.map(item => {
    // Each 'item.json' is a single absence record
    const absence = item.json;

    // Skip processing if the leave type is 'Work From Home'
    if (absence['Leave Type'] === 'Work From Home') {
        return null; // Skip this item
    }

    // Parse Start and End dates reliably by setting the time to noon
    const startDate = new Date(absence.Start);
    startDate.setHours(12, 0, 0, 0); // Prevent timezone issues

    const endDate = new Date(absence.End);
    endDate.setHours(12, 0, 0, 0); // Prevent timezone issues

    // Prepare an object to hold all the date and leave type pairs for this absence
    let datesToUpdate = {};

    // Define a mapping for leave types
    const leaveTypeMapping = {
        "Holiday - Employees": "V",
        "Sick Days - Employees": "SL",
        "Paid Leave - Croatia Employees": "L",
        "Days Off": "L", 
        "Wellbeing Day - Employees": "WBD", 
        "Blood Donor - Day off - Croatia Employees": "L"
    };

    // Get the leave type letter based on the mapping, or use "UL" as a fallback
    const leaveType = absence['Leave Type'];
    const leaveTypeFirstLetter = leaveTypeMapping[leaveType] || "UL";

    // Initialize current date to startDate
    let currentDate = new Date(startDate);

    // Iterate until currentDate exceeds endDate
    while (currentDate.getTime() <= endDate.getTime()) {
        // Format the date to match the format in your file (D/M/YY)
        const day = currentDate.getDate(); // Day without leading zero
        const month = currentDate.getMonth() + 1; // Month without leading zero
        const year = currentDate.getFullYear().toString().substr(-2); // Last two digits of the year
        const formattedDate = `${day}/${month}/${year}`;

        // Add the formatted date as a key and the leave type letter as a value
        datesToUpdate[formattedDate] = leaveTypeFirstLetter;

        // Move to the next day
        currentDate.setDate(currentDate.getDate() + 1);
    }

    // Add a new property to the item to hold the dates to update and leave type letter
    item.json.datesToUpdate = datesToUpdate;

    // Add a source identifier
    item.json.source = 'absenceData';

    // Return the modified item
    return item;
}).filter(item => item !== null); // Filter out null items (skipped items)

// Entry you are looking for
const searchEntry = "COPY ROW FOR NEW";

// Initialize variable to store the row number
let foundRowNumber = -1;

// Loop through each item (object) in the incoming data
for (let item of items) {
    // Check if the 'Name' field matches the searchEntry
    if (item.json['Name'] === searchEntry) {
        foundRowNumber = item.json['No'];
        break; // Exit loop once found
    }
}

// Prepare the result in the expected return structure
let result;

// Add the result to an object
if (foundRowNumber !== -1) {
    result = { json: { "No": foundRowNumber }};
} else {
    result = { json: { message: "Entry not found" }};
}

// Return the result in an array
return [result];

// EXPECTS:
// - items[0].json.No -> target (int; min 6)
// - items.slice(3) -> source rows

if (!items || items.length === 0) return [];

const TARGET_MIN = 6;
const rawTarget = items[0]?.json?.No;
const targetRowNumber = Number.parseInt(String(rawTarget ?? ''), 10);

if (!Number.isFinite(targetRowNumber) || targetRowNumber < TARGET_MIN) {
  return [{ json: { message: 'Target row invalid/small', rawTarget } }];
}

const source = items.slice(3).map(it => it.json);
if (!source.length) return [{ json: { message: 'Source data is empty.' } }];

const SENTINELS = new Set(["V","SL","L","UL","WBD","//"]);
const upper = Math.min(targetRowNumber - 1, source.length);

function norm(v) {
  if (v === null || v === undefined) return '';
  if (typeof v === 'object') {
    try { const s = JSON.stringify(v); return s.length > 5000 ? s.slice(0,5000)+'…' : s; }
    catch { return String(v); }
  }
  return String(v);
}
function shouldClear(v) { return SENTINELS.has(norm(v).trim()); }

// OPTIONAL “current rows” diff: ako si negdje ranije Merge-om dodao items[0].json.current = arr,
// kod ispod će slati SAMO stvarne promjene; ako nema current → radi bez diffa (svejedno je lagano).
const current = (items[0]?.json?.current && Array.isArray(items[0].json.current)) ? items[0].json.current : null;

const out = [];
for (let i = 1; i <= upper; i++) {
  const src = source[i - 1] || {};
  const row = { No: String(i) };
  let changed = false;

  for (const [k, v] of Object.entries(src)) {
    if (k === 'No') continue;

    let nextVal = '';
    if (shouldClear(v)) {
      nextVal = '';
    } else {
      nextVal = norm(v).trim();
      if (nextVal === '') continue; // ne šaljemo praznine bez potrebe
    }

    if (current) {
      const curVal = norm(current[i - 1]?.[k] ?? '').trim();
      if (curVal === nextVal) continue; // diff: šalji samo promjene
    }

    row[k] = nextVal;
    changed = true;
  }

  if (changed) out.push({ json: row });
}

if (!out.length) return [{ json: { message: 'No diffs to update.' } }];

return out;

// Removing weekend dates from output
const weekendDates = items[0].json;
let result = [];

items.slice(1).forEach(item => {
  const person = item.json;
  let filteredVacationDates = {};

  Object.keys(person).forEach(key => {
    if (key !== 'Name' && !weekendDates.hasOwnProperty(key)) {
      filteredVacationDates[key] = person[key];
    }
  });

