});

return result;

// Check if there are any input items
if (items.length < 2) {
    return [{ json: { message: 'Insufficient input data.' } }];
}

// Separate the holiday update data and the weekend data
const holidayUpdateData = items.filter(item => item.json.No !== undefined);
const weekendData = items.find(item => item.json.No === undefined);

// Get the weekend dates object
const weekendDates = weekendData ? weekendData.json : {};

// Process holiday update data to include weekend dates with value "//"
let result = holidayUpdateData.map(item => {
    let updatedRow = { ...item.json };
    for (const [date, value] of Object.entries(weekendDates)) {
        updatedRow[date] = "//"; // Set weekend dates to "//"
    }
    return { json: updatedRow };
});

// Return the updated data
return result;

if (items.length > 0) {
    const firstItem = items[0].json;

    let filteredKeyValuePairs = {};

    // Function to determine if a date is a weekend
    function getDayOfWeek(dateString) {
        const [day, month, year] = dateString.split('/').map(Number);
        const date = new Date(year + (year < 100 ? 2000 : 0), month - 1, day); // Adjust year for 2-digit format
        const dayOfWeek = date.getDay();
        return dayOfWeek; // 0 = Sunday, 6 = Saturday
    }

    for (const key in firstItem) {
        if (firstItem.hasOwnProperty(key)) {
            const dayOfWeek = getDayOfWeek(key);
            if (/^\d/.test(key) && (firstItem[key] === 'Sat' || firstItem[key] === 'Sun' || dayOfWeek === 0 || dayOfWeek === 6)) {
                filteredKeyValuePairs[key] = dayOfWeek === 0 ? 'Sun' : dayOfWeek === 6 ? 'Sat' : firstItem[key];
            }
        }
    }

    return [{ json: filteredKeyValuePairs }];
} else {
    return [];
}

// Function to get current date and time in a specific format
function getCurrentDateTime() {
    const now = new Date();
    const date = now.toISOString().split('T')[0]; // YYYY-MM-DD format
    const time = now.toTimeString().split(' ')[0]; // HH:MM:SS format
    return date + ' ' + time;
}

// Get the current date and time
const dateTime = getCurrentDateTime();

// Read the delta data from the input items
const deltaData = items.map(item => item.json);

// Check if the delta data contains any changes
const hasChanges = deltaData.some(entry => Object.keys(entry).length > 0);

// Prepare the data to pass to the next node
const dataToAppend = {
    json: {
        "Last Sync": dateTime,
        "Delta": hasChanges ? deltaData : "NO CHANGES"
    }
};

return [dataToAppend];

// Function to calculate the delta between two arrays of objects
function calculateDelta(current, previous) {
    let delta = [];

    for (let currentEntry of current.data) {
        let previousEntry = previous.data.find(entry => entry.Name === currentEntry.Name);
        if (!previousEntry) {
            // If the entry does not exist in the previous data, consider all its data as new
            delta.push(currentEntry);
        } else {
            let changedFields = { "Name": currentEntry.Name };
            let hasChanges = false;
            for (let key in currentEntry) {
                if (currentEntry[key] !== previousEntry[key] && key !== "Name") {
                    changedFields[key] = currentEntry[key];
                    hasChanges = true;
                }
            }
            if (hasChanges) {
                delta.push(changedFields);
            }
        }
    }
    return delta;
}

// Read the last_sync and current_sync data from the input items
const lastSyncData = items[0].json;
const currentSyncData = items[1].json;

// Calculate the delta
const delta = calculateDelta(currentSyncData, lastSyncData);

// Prepare the output
let output;
if (delta.length === 0) {
    // If there are no changes, output an empty JSON object
    output = { json: {} };
} else {
    // If there are changes, output the delta values
    output = delta.map(item => ({ json: item }));
}

return output;

