if (Array.isArray(inputData.Delta) && inputData.Delta.length > 0) {
  // Add blocks for each delta entry
  inputData.Delta.forEach(entry => {
    let deltaText = `*Name:* ${entry.Name}\n`;

    for (let key in entry) {
      if (key !== "Name") {
        deltaText += `*${key}:* ${entry[key]}\n`;
      }
    }

    blocks.push({
      "type": "section",
      "text": {
        "type": "mrkdwn",
        "text": deltaText
      }
    });

    blocks.push({
      "type": "divider"
    });
  });
} else {
  // Handle case where Delta is not present or empty
  blocks.push({
    "type": "section",
    "text": {
      "type": "mrkdwn",
      "text": "*No changes from the last sync*"
    }
  });
}

// Prepare the output data
return [{ json: { blocks: blocks, text: "Sync Job Completed Successfully!" } }];
